#include<iostream>
#include<cstdio>
#include<cmath>
#include<algorithm>
#include<vector>
#include<cstring>
#include<map>
#include<iomanip>
#define DEBUG
using namespace std;
bool dp[200010000];

inline int index(int i, int j){
	return (40001-i)*i/2+j-i;
}

bool compute(string s){
	int len = s.size();
	for(int i=0; i<len; ++i)
		//dp[index(i,i)] = true;
		dp[(40001-i)*i/2] = true;
	for(int i=0; i<len-1; ++i)
		//dp[index(i,i+1)] = (s[i] == s[i+1]) ? true : false;
		dp[(40001-i)*i/2+1] = (s[i] == s[i+1]) ? true : false;
	for(int step = 2; step < len; ++step)
		for(int i=0; i<len-step; ++i)
			//dp[index(i, i+step)] = (s[i] == s[i+step] && dp[index(i+1,i+step-1)]) ? true : false;
			dp[(40001-i)*i/2+step] = (s[i] == s[i+step] && dp[(40000-i)*(i+1)/2+step-2]) ? true : false;
	for(int i=0; i<len-2; ++i)
		for(int j= i+2; j<len; ++j)
			//if(dp[index(0,i)] && dp[index(i+1,j-1)] && dp[index(j,len-1)])
			if(dp[i] && dp[(40000-i)*(i+1)/2+j-i-2] && dp[(40001-j)*j/2+len-j-1])
				return true;
	return false;
}

int main(){
#ifdef DEBUG
	freopen("in.txt", "r", stdin);
	freopen("out.txt", "w", stdout);
#endif
	ios::sync_with_stdio(false);
	int T;
	cin>>T;
	while(T--){
		string s;
		cin>>s;
		cout<<(compute(s) ? "YES" : "NO")<<endl;
	}
	return 0;
}

